import matplotlib.pyplot as plt

def plot_speed(txt_file):

    with open(txt_file, 'r') as f:
        lines = f.readlines()
        speed = [float(line.split()[0]) for line in lines]
        speed = speed[4:len(speed)//2]
    
    VELOCITY = [7] * len(speed)
    t = [i/100. for i in range(len(speed))]
    plt.figure()
    plt.plot(t,VELOCITY,color='r')
    plt.scatter(t,speed,s=1)
    plt.xlabel('Time')
    plt.ylabel('Speed')
    plt.legend(["Commanded Velocity", "Actual Velocity"])
    plt.show()

# PLOT #1
plot_speed('speed_log.txt')

